import React from 'react';

class App extends React.Component {

    componentDidMount() {

        var getShifts = 'https://noname.lab.medsolv.net/Shifts';

        function getShifts() {
            fetch(getShifts)
                .then(function (response) {
                    return response.json();
                })
                .then(function (myJson) {
                    var shifts = JSON.stringify(myJson)
                    console.log(shifts);
                });
        }

        getShifts();

    }
}

export default App;
